INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (9, 5, "探検好きのイタズラっ子", "リトルリリカル", "いたずら、探検", "ミソギ", 10, 128, 0, 27, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "O", 100401, "ヒューマン", "諸星すみれ", 8);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, 8, "ヒーローに憧れる騎士見習いの少女", "王宮騎士団（NIGHTMARE）", "ヒーローごっこ", "マツリ", 25, 146, 0, 40, "？？？", "O", 100501, "獣人族", "下田麻美", 11);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, 7, "甘え上手なみんなの人気者", "悪魔偽王国軍（ディアボロス）", "サックス", "アカリ", 22, 150, 0, 42, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "O", 100601, "魔族", "浅倉杏美", 11);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (14, 7, "プリン大好きゴースト娘", "悪魔偽王国軍（ディアボロス）", "プリンを食べること", "ミヤコ", 23, 130, 0, 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "B", 100701, "魔族", "雨宮天", 1);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (14, 15, "ボクは誰よりも美しい", "ヴァイスフリューゲル　ランドソル支部", "鏡で自分を見ること", "ユキ", 10, 150, 0, 40, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "AB", 100801, "エルフ", "大空直美", 10);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 13, "前世を信じる中二病患者、「疾風の冥姫」", "トワイライトキャラバン", "小説執筆", "アンナ", 5, 159, 0, 45, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "A", 100901, "魔族", "髙野麻美", 7);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (16, 10, "マホマホ王国のプリンセス", "自警団（カォン）", "空想、ぬいぐるみ集め", "マホ", 22, 155, 0, 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "O", 101001, "獣人族", "内田真礼", 9);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (15, 3, "人懐っこくてマシンガントークな妹系少女", "ラビリンス", "お裁縫", "リノ", 25, 156, 0, 44, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "A", 101101, "ヒューマン", "阿澄佳奈", 8);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 6, "みんなのために超能力を使う眠り姫", "フォレスティエ", "妹と遊ぶこと、二度寝、昼寝、早寝", "ハツネ", 24, 156, 0, 46, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "A", 101201, "エルフ", "大橋彩香", 12);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (18, 13, "オタク全開な魔法少女", "トワイライトキャラバン", "読書、魔法", "ナナカ", 21, 166, 0, 55, "", "O", 101301, "魔族", "佳村はるか", 8);
