INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (21, 6, "母性溢れる優しいみんなの「ミサト先生」", "フォレスティエ", "絵本作り", "ミサト", 5, 165, 0, 54, "test", "O", 101501, "エルフ", "國府田マリ子", 9);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 14, "天真爛漫で人気者のカリスマモデル", "ルーセント学院", "ファッション", "スズナ", 10, 167, 0, 48, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "O", 101601, "魔族", "上坂すみれ", 4);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 10, "いつでも「なんくるないさ～」な天然娘", "自警団（カォン）", "踊り、空手", "カオリ", 7, 158, 0, 53, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "A", 101701, "獣人族", "高森奈津美", 7);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (23, 14, "多くの男性を魅了する無垢な女教師", "ルーセント学院", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "イオ", 14, 162, 0, 52, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "B", 101801, "魔族", "伊藤静", 8);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (10, 5, "お歌もにんじんも、ウサギさんも大好き♪", "リトルリリカル", "かわいいもの集め", "ミミ", 3, 117, 0, 21, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "O", 102001, "獣人族", "日高里菜", 4);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, 9, "泣き虫で臆病な守ってあげたい女の子", "サレンディア救護院", "観劇、おままごと", "クルミ", 9, 150, 0, 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "B", 102101, "ヒューマン", "植田佳奈", 6);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (13, 7, "人見知りであまのじゃくな女の子", "悪魔偽王国軍（ディアボロス）", "ゲーム全般", "ヨリ", 22, 150, 0, 40, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "O", 102201, "魔族", "原紗友里", 11);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (14, 9, "ぷうきちといつも一緒！", "サレンディア救護院", "屋内でできる遊び", "アヤネ", 10, 148, 0, 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "B", 102301, "ヒューマン", "芹澤優", 5);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (15, 9, "お嬢さまのためにがんばるドジっ娘メイド", "サレンディア救護院", "ご奉仕", "スズメ", 12, 154, 0, 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "O", 102501, "ヒューマン", "悠木碧", 12);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 11, "遊びと睡眠が何より大事なぐうたら娘", "牧場（エリザベスパーク）", "あんパン", "リン", 1, 144, 0, 42, "test", "B", 102601, "獣人族", "小岩井ことり", 1);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (16, 13, "運命の相手に一途すぎる乙女", "トワイライトキャラバン", "実験、裁縫、料理", "エリコ", 30, 154, 0, 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "B", 102701, "魔族", "橋本ちなみ", 7);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 9, "救護院を経営する優しい庶民派お嬢様", "サレンディア救護院", "経営、お茶会", "サレン", 4, 156, 0, 43, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "A", 102801, "エルフ", "堀江由衣", 10);
