INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (16, 15, "トーゴクの神秘、オシエテクダサイ！", "ヴァイスフリューゲル　ランドソル支部", "忍法開発", "ニノン", 31, 163, 0, 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "O", 103001, "ヒューマン", "佐藤聡美", 8);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (18, 7, "占いが得意な霊能少女", "悪魔偽王国軍（ディアボロス）", "占い", "シノブ", 22, 157, 0, 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "AB", 103101, "魔族", "大坪由佳", 12);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (18, 12, "一人前の商人を目指すパワフルお嬢様", "メルクリウス財団", "慈善事業", "アキノ", 12, 157, 0, 45, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "AB", 103201, "ヒューマン", "松嵜麗", 3);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (20, 11, "みんなを笑顔にするお笑い牧場主", "牧場（エリザベスパーク）", "漫才", "マヒル", 3, 142, 0, 35, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "B", 103301, "ヒューマン", "新田恵海", 3);
