INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 4, "人々を守るために歌う、唱喚士の少女", "カルミナ", "各種楽器", "チカ", 3, 163, 0, 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "O", 104201, "ヒューマン", "福原綾香", 6);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 10, "男勝りで情に厚いワイルド娘", "自警団（カォン）", "お菓子作り", "マコト", 9, 168, 0, 54, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "O", 104301, "獣人族", "小松未可子", 8);
