INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (18, 15, "妄想大好き！　ほんとは照れ屋な女の子", "ヴァイスフリューゲル　ランドソル支部", "小説を読むこと", "クウカ", 19, 157, 0, 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "AB", 104501, "ヒューマン", "長妻樹里", 11);
