INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (20, 12, "仕事も私事も効率優先な傭兵少女", "メルクリウス財団", "傭兵などのアルバイト", "ミフユ（サマー）", 11, 163, 0, 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "O", 108001, "ヒューマン", "田所あずさ", 11);
