INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 4, "人々を守るために歌う、唱喚士の少女", "カルミナ", "各種楽器", "チカ（クリスマス）", 3, 163, 0, 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "O", 108401, "ヒューマン", "福原綾香", 6);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (12, 9, "泣き虫で臆病な守ってあげたい女の子", "サレンディア救護院", "観劇、おままごと", "クルミ（クリスマス）", 9, 150, 0, 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "B", 108501, "ヒューマン", "植田佳奈", 6);
