INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (16, 2, "人助けが大好き！　前向き格闘娘", "トゥインクルウィッシュ", "人助け、応援", "ヒヨリ（ニューイヤー）", 27, 155, 0, 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "A", 108701, "獣人族", "東山奈央", 8);
INSERT INTO `v1_8234d10af234ff318d38ac1aa8f42ec39cf8101fde2a5f4a0faa6218ee99ca93` VALUES (17, 2, "戦闘のサポートが得意な、心優しい少女", "トゥインクルウィッシュ", "料理、人間観察", "ユイ（ニューイヤー）", 5, 158, 0, 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "O", 108801, "ヒューマン", "種田梨沙", 4);
